import React from 'react'
import {Switch,Route} from 'react-router-dom'
import ReactHome from './content/React-Home'
import ReactEnvironment from './content/React-environment'
import Layout from './Layout'

const Router=()=>{
  return(
    <Layout >

    <Link to='/react' component={ReactHome}/>
    <Link  exact path='/react/environment' component={ReactEnvironment}/>
  
  </Layout>
  )

}

export default Router;
